import React from 'react'
import styled from 'styled-components';

function Account() {
    return (
        <Container>
            <ContentAccount>
                Your Account
            </ContentAccount>
            <ContentAccountDiv>
                <ThreeDiv>
                    <img src="https://images-na.ssl-images-amazon.com/images/G/01/x-locale/cs/help/images/gateway/self-service/order._CB660668735_.png" alt="" />
                    <div>
                        <p>Your Orders</p>
                        <p>Track, return, or buy things again</p>
                    </div>
                </ThreeDiv>
                <ThreeDiv>
                        <img src="https://images-na.ssl-images-amazon.com/images/G/01/x-locale/cs/help/images/gateway/self-service/order._CB660668735_.png" alt="" />
                            <div>
                                <p>Your Orders</p>
                                <p>Track, return, or buy things again</p>
                            </div>
                </ThreeDiv>
                <ThreeDiv>
                        <img src="https://images-na.ssl-images-amazon.com/images/G/01/x-locale/cs/help/images/gateway/self-service/order._CB660668735_.png" alt="" />
                        <div>
                            <p>Your Orders</p>
                            <p>Track, return, or buy things again</p>
                        </div>
                </ThreeDiv>
            </ContentAccountDiv>
            <ContentAccountDiv>2</ContentAccountDiv>
            <ContentAccountDiv>3</ContentAccountDiv>
        </Container>
    )
}

export default Account

const Container = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    background-color: orange;
    margin-top: 20px;
    flex-direction: column;
`
const ContentAccount = styled.div`
    margin-left:-30%;
    font-size:30px;
`

const ContentAccountDiv = styled.div`
    background-color: red;
    width:70%;
    height:40%;
    margin:10px 0px;
    display: flex;
    justify-content: space-between;
`
const ThreeDiv = styled.div`
   border: 1px solid black;
   display:flex;
   img{
       height:90px;
   }

`
